import "./ConhecaOApp.css"

const ConhecaOApp = (props)=>{
    return(
        <div className="ctn-conheca-o-app">
            <div className="ctn-content-ap">
                <div className="title-">
                    A nossa solução ainda não está pronta :(
                </div>
